import React from 'react';
import { Zoom } from 'react-slideshow-image';
import 'react-slideshow-image/dist/styles.css'
import slide_2 from './images/slide_2.jpg';
import slide_3 from './images/slide_3.jpg';
import slide_4 from './images/slide_4.jpg';

const Slideshow = () => {
  const images = [
    slide_2,
    slide_3,
    slide_4
  ];
  
  const zoomInProperties = {
    indicators: true,
    scale: 1.4
  }
  return (
    <div >
      <Zoom {...zoomInProperties} transitionDuration={1000} style={{width: 350,marginLeft:'10%'}}>
        {images.map((each, index) => 
        {console.log(each,"each");return (
          <div key={index} style={{width: '80%'}}>
            <img style={{ objectFit: "cover", width: '80%',height:250 }} src={each}/>
          </div>
        )})}
      </Zoom>
    </div>
  )
}

export default Slideshow;
